func test2() {
	res := "subject=C = CN, ST = BJ, L = HaiDian, O = Beijing JNTA Technology LTD., OU = SORB of TASS, CN = Test CA (SM2)"
	compileRegex := regexp.MustCompile("OU = (.+)")
	matchArr := compileRegex.FindStringSubmatch(res)
	if len(matchArr) == 0 {
		fmt.Println("err")
		return
	}
	org := matchArr[len(matchArr)-1]
	fmt.Printf("org:%s", org)

}
func test() {
	res := "Public-Key: (256 bit)"

	compileRegex := regexp.MustCompile(`Public-Key: (.+)`)
	matchArr := compileRegex.FindStringSubmatch(res)
	fmt.Printf("matchArr:%v\n", matchArr)
	if len(matchArr) == 0 {
		return
	}
	fmt.Println(matchArr)
	fmt.Println(len(matchArr))
	target := matchArr[len(matchArr)-1]
	target = target[1 : len(target)-10]
	fmt.Println("target:%v\n", target)
}
func ContainString(arr []string, target string) bool {
	for _, v := range arr {
		if v == target {
			return true
		}
	}
	return false
}

